husetts economy needs '),(1,'fullname',0,1,' kendall square '),(1,'email',0,1,' tech upstatement com '),(1,'slug',0,1,''),(32,'field',6,1,' massachusetts is a global economic leader because of our culture of innovation but our transportation system is holding us back employee commutes are becoming longer and more unpredictable our status quo transit network concentrates growth and wealth only in certain communities driving up housing prices and the costs of doing business employers and employees alike are stressed and frustrated and it is time to take action we must invest in a new vision for transportation and connect with our legislators to build a revenue package that will move massachusetts beyond a state of good repair and invest in a system that reflects what our economy should be ksa has taken action to respond to the transportation challenges facing our innovation community ensuring the economic vitality of kendall is the cornerstone of our work connecting the people changing the world over the past six months we gathered with other business leaders in the commonwealth to learn about the issues impacting our communities and developed solutions to invest in a transportation system that works for us all our transportation advocacy efforts included sending a letter from 40 kendall ceos to the governor speaker and senate president demanding action on our transportation crisis releasing the transport kendall report to highlight the infrastructure investments we need in kendall co hosting a forum to educate business leaders on transportation revenue options that was attended by more than 80 people hosting a transportation learning community meeting about the transportation revenue policy options launching our transportation advance our collective effort to find solutions to our short term commuting woes with 19 companies representing nearly 20 000 employees sharing our collective transportation revenue recommendations with 155 massachusetts state legislators and members of governor bakers administration massachusetts residents deserve a transportation system that is multi modal modern convenient and predictable physically accessible to all resilient to extreme weather safe and clean low carbon and responsive to technological innovations we partnered with the american council of engineering companies of massachusetts black economic council of massachusetts brookline chamber of commerce climate action business association masstlc massbio new england venture capital association and newton needham regional chamber to develop a list of problems that we as a business community are facing and proposed solutions worth exploring you can access the full report here traffic steals time from employees and businesses with some of the worst traffic in the nation and the current status of our transportation system puts massachusetts economic prosperity in jeopardy there are three different user fees for driver proposed policy solutions gas tax increasing the state gas tax by at least 18 per gallon will bring in additional funds dedicated to road maintenance bridge repair and transit services transportation network company fees tncs tnc fees should be increased to encourage shared rides walking biking and public transit when applicable roadway pricing this tool is a proven way to curb congestion including but not limited to freight on the most gridlocked roadways within 128 reduce emissions and fund new transportation options congestion pricing must be combined with steps to mitigate the impact of these fees on low income drivers climate change poses a significant threat to the states economy and businesses that call massachusetts home today the transportation sector represents over 40% of emissions in the commonwealth and that projection is on the rise businesses see the value in reducing our carbon footprint to remain competitive support a resilient economy invest in more equitable and smarter travel and sustainable infrastructure we support a robust and equitable transportation climate initiative as a solution that can make progress on both transportation needs and the states climate goals the state should prioritize a process that includes the voices of low income and moderate income individuals and develop a policy where revenue is invested in protecting our communities from transportation related emissions in modernizing the system to ensure that all residents have access to a safe affordable reliable and clean transportation system and use tci revenue to make our transportation system resilient to the effects of climate change businesses in different areas of the state are facing different transportation related challenges and the local cities and towns arent empowered to lead on solutions currently it is virtually impossible to meet these needs at the local or regional level because municipalities dont have a way to raise local money to partner with businesses to invest in local solutions we are proposing three different tools for local investment regional ballot initiatives are used throughout the country by municipalities or groups of municipalities to raise additional local money for transportation projects through ballot initiatives expand public private partnership opportunities will help bring private sector knowledge innovation and funding to specific transportation projects value capture to help cities and towns work with the state to invest in transportation infrastructure by capturing the value created in the area surrounding a new development in order to support transit upgrades everyday businesses across the commonwealth bear the cost of an unreliable and unpredictable transportation system we need to ensure dollars are well spent the policy solution we propose includes two accountability tools make the fiscal management control board fmcb permanent upon the expiration of the current fmcb in 2020 a governance structure should be established to provide transparency about mbta spending and project delivery the board should consist of appointed officials representing a range of interests with a focus on providing strategic guidance for fiscal responsibility work with massdot to provide more information on its web site about project commitments and progress we recommend that massdot convene a stakeholder group of business municipal and environmental leaders to work with massdot to determine what would be useful for the public to see quarterly on massdots plans and progress the goal would be to create a stronger website presence that enables the public to access and easily understand how the agency is performing against performance targets project commitments and budgets '),(35,'kind',0,1,' image '),(35,'slug',0,1,''),(35,'extension',0,1,' png '),(35,'filename',0,1,' 1 lyf8sztsddexiit8tmh5ug png '),(36,'kind',0,1,' image '),(36,'slug',0,1,''),(36,'extension',0,1,' png '),(36,'filename',0,1,' 1 buiqwpwshsv4v7wr0dnjq png '),(37,'kind',0,1,' image '),(37,'extension',0,1,' png '),(37,'filename',0,1,' 1 aqtkpj1n37cq0qmjsjtk g png '),(40,'slug',0,1,''),(41,'slug',0,1,''),(41,'field',9,1,' blog post funding the tr '),(41,'field',10,1,' funding the transportation system the massachusetts economy needs '),(42,'slug',0,1,''),(42,'field',9,1,''),(40,'field',70,1,' about '),(2487,'slug',0,1,' technology '),(2487,'title',0,1,' technology '),(2488,'slug',0,1,' design '),(2488,'title',0,1,' design '),(42,'field',10,1,' homepage '),(43,'kind',0,1,' image '),(43,'extension',0,1,' png '),(43,'filename',0,1,' ksq bw1 png '),(44,'kind',0,1,' image '),(44,'extension',0,1,' png '),(44,'filename',0,1,' ksq bw2 png '),(45,'kind',0,1,' image '),(45,'extension',0,1,' png '),(45,'filename',0,1,' ksq bw3 png '),(46,'kind',0,1,' image '),(46,'extension',0,1,' png '),(46,'filename',0,1,' ksq bw4 png '),(48,'slug',0,1,''),(48,'field',20,1,' whos here '),(48,'field',22,1,' the kendall square association is made up of more than 170 member organizations committed to growing the ke